(6, 2, 4, 'Mn°6', '2017_M_006_FR_V1', 'Déontologie', 'L\'environnement règlementaire autour du médicament a évolué pour permettre une plus grande transparence ey éviter des abus. Ce module aborde la loi anti-cadeaux (DMOS) et la transparence des liens.', NULL, '00:45:00', 'Prenez le temps de lire chaque écran, pop-up et d\'écouter la voix-off ou de lire le cours.', 1, '/scorm/6/d2488e02-badb-40ab-a046-89017fea056d.zip/index.html', NULL, NULL, NULL, 'deontologie-mndeg6', 1, 0, 2, '2019-10-14 16:35:45', '2019-10-14 16:35:47', '5da487c1e4bfc502862235.png', '2019-10-14 16:35:45', 0, 0),
(7, 2, 5, 'Mn°7', '2017_M_009_FR_V2', 'Présentation UMG V2', 'Ce module vous présente les activités du groupe UMG et ses différentes filiales : Universal Medica, Cherry, Europharma et Bbac.', NULL, '00:20:00', 'Prenez le temps de lire chaque écran, pop-up et d\'écouter la voix-off ou de lire le cours.', 1, '/scorm/7/29f1b712-53bf-421d-9ecc-23775ffb343c.zip/index.html', NULL, NULL, NULL, 'presentation-umg-v2-mndeg7', 1, 0, 2, '2019-10-14 16:37:20', '2019-10-14 16:37:21', '5da4882000dbe654018134.png', '2019-10-14 16:37:20', 0, 0),
(8, 2, 7, 'Mn°8', '2017_M_001_FR_V1', 'Environnement pharmaceutique', 'Nos clients sont majoritairement des laboratoires pharmaceutiques. Ce module vous permet de décourvrir l\'environnement de l\'industrie pharmaceutique et du médicament.', NULL, '01:00:00', 'Prenez le temps de lire chaque écran, pop-up et d\'écouter la voix-off ou de lire le cours.\r\nAfin de réaliser l\'évaluation du module Médicament, la lecture de ce module et du module Médicament est requise.', 1, '/scorm/8/fbdd56b8-df7e-4485-9f71-87c685ecd370.zip/index.html', NULL, NULL, NULL, 'environnement-pharmaceutique-mndeg8', 1, 0, 6, '2019-10-14 16:59:02', '2019-10-15 12:06:35', '5da48d36f1568494531145.png', '2019-10-14 16:59:02', 0, 0),
(9, 2, 8, 'Mn°9', '2017_M_002_FR_V1', 'Médicament', 'Ce module vous permet de comprendre le circuit administratif du médicament :  AMM, prix et remboursement.\r\nLes différentes classes de médicaments et leurs règles de dispensation / prescription sont également abordées.', NULL, '01:30:00', 'Prenez le temps de lire chaque écran, pop-up et d\'écouter la voix-off ou de lire le cours.\r\nAfin de réaliser l\'évaluation de ce module, la lecture de ce module et du module Environnement pharmaceutique est requise.', 1, '/scorm/9/a0379c72-3578-4402-93ba-d2a16eb4d488.zip/index.html', NULL, NULL, NULL, 'medicament-mndeg9', 1, 0, 3, '2019-10-14 17:09:17', '2019-10-15 12:05:52', '5da48f9d0c6ae845361455.png', '2019-10-14 17:09:17', 0, 0),
(10, 2, 9, 'Mn°10', '2017_M_008_FR_V2', 'Qualité V2', 'Ce module vous présente la politique qualité du groupe Universal Médica et son application au sein de chaque filiale avec notamment l’utilisation de QUALIOS.', NULL, '01:15:00', 'Prenez le temps de lire chaque écran, pop-up et d\'écouter la voix-off ou de lire le cours.', 1, '/scorm/10/4f8ac520-72c6-4370-a91f-ffb74f31df07.zip/index.html', NULL, NULL, NULL, 'qualite-v2-mndeg10', 1, 0, 2, '2019-10-14 17:11:18', '2019-10-14 17:11:19', '5da4901613c29498544225.png', '2019-10-14 17:11:18', 0, 0);
